import React from "react";

const MovieList = (props) => {
  return (
    <div>
        {props.movies.map(m => {
          return <ul><li>{props.movie.Title} ({props.movie.Year})</li>
          <button onClick={() => props.handleFavouritesClick(m)}> Nominate </button>
          </ul>
        })}
    </div> 
  );
};

export default MovieList;
